import { Breadcrumb } from "antd";
import Link from "next/link";

const BreadCrumb = ({list}) => {
    const breadcrumb = list.map((item,i) => {
        return (
            <Breadcrumb.Item key={i}>
                <Link>
                    <span className="mylink">{item.name}</span>
                </Link>
            </Breadcrumb.Item>
        )
    })
    return (
        <Breadcrumb>
           {breadcrumb}
        </Breadcrumb>
    )

}

export default BreadCrumb;
